const dialog = ({}) => {
    return(
        <div className="dialogBox">
            <div className="Message">
            <h3>Message</h3>
            </div>
            <div className="Confirmation">
                <button className="Yes">Yes</button>
                <button className="No">No</button>
            </div>
            
        </div>

    )
}

export default dialog;
